import Carousel from './SpecialsCarousel';
// import GreekSalad from '../../../assets/food/greek-salad.webp';
import LumpiangSariwa from '../../../assets/food/lumpiang_sariwa.png';
// import Bruschetta from '../../../assets/food/bruschetta.jpeg';
import PancitBihonGuisado from '../../../assets/food/pancit_guisado.jpeg';
// import LemonDessert from '../../../assets/food/lemon-dessert.webp';
import adobongKangkong from '../../../assets/food/adobongKangkong.png';
import SpecialCard from './CardInfo/SpecialCard';

export default function Specials() {
    return (
        <section className="specials">
            <article className="specials-topbar">
                <h1>This weeks specials</h1>
                <a className="action-button" href={require('../../../assets/check_back_menu.pdf')} target="_blank" rel="noreferrer">Online Menu</a>
            </article>

            <section className="specials-cards">
                {/* <SpecialCard image={GreekSalad} name="Greek Salad" price="$12.99" description="Refreshing salad, made with tomato, lettuce, feta cheese, and olives.
                 Dressed with salt, hot pepper, and olive oil."/> */}
                <SpecialCard image={LumpiangSariwa} name="Lumpiang Sariwa" price="$12.99" description="Vegan lumpiang sariwa is a fresh and flavorful Filipino spring roll filled with an assortment of crisp vegetables, tofu, and served with a savory peanut sauce."/>
                {/* <SpecialCard image={Bruschetta}name="Bruschetta" price="$16.99" description="Toasted bread, topped with tomato, prosciutto, and cheese. Seasoned with
                 salt and olive oil."/>
                <SpecialCard image={LemonDessert} name="Lemon Dessert" price="$8.50" description="Fresh baked lemon bread coated in salt and sugar. Powdered in citrus
                 and lemon zest."/> */}
                <SpecialCard image={PancitBihonGuisado}name="Pancit Bihon Guisado" price="$16.99" description="Vegan Pancit Bihon Guisado is a delightful Filipino stir-fried noodle dish made with rice noodles, an array of colorful vegetables, and flavorful seasonings, all prepared without the use of any animal products."/>
                <SpecialCard image={adobongKangkong} name="Adobong Kangkong" price="$12.50" description="Vegan Adobong Kangkong is a delectable Filipino dish featuring water spinach stir-fried with garlic, soy sauce, vinegar, and spices, providing a savory and plant-based twist to this traditional favorite."/>
            </section>

            <section className="specials-carousel">
                <Carousel />
            </section>
        </section>
    );
}
